import { useState, useEffect } from "react";
import axios from "axios";
import "../styles/admissionportal.css";
function AdmissionPortal() {
  const [applications, setLoginData] = useState([]);
  useEffect(() => {
    const fetchAllCredentials = async () => {
      try {
        const res = await axios.get("http://localhost:8800/applicants");
        setLoginData(res.data);
        console.log(res.data);
      } catch (err) {
        console.log(err);
      }
    };
    fetchAllCredentials();
  }, []);
  return (
    <div id="admissionP-container">
      <div id="admissionP">
        <h1>Applications</h1>
            <tr>
              <th>Roll Number</th>
              <th>Email</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Department</th>
              <th>Semester</th>
              <th>City</th>
              <th>Address</th>
              <th>CGPA</th>
            </tr>
            {applications.map((application) => (
              <tr key={application.RollNumber}>
                <td>{application.RollNumber}</td>
                <td>{application.Email}</td>
                <td>{application.FirstName}</td>
                <td>{application.LastName}</td>
                <td>{application.Department}</td>
                <td>{application.Semester}</td>
                <td>{application.City}</td>
                <td>{application.Address}</td>
                <td>{application.CGPA}</td>
              </tr>
            ))}
      </div>
    </div>
  );
}

export default AdmissionPortal;
